description:
Extends System.Collections.Generic.IDictionary´2 with EnsureValueFor and AddToCollection: 
    
      a) EnsureValueFor(TKey key): Creates a instance of TValue for the given key and returns it; 
      
      b) AddToCollection(TKey key, item(s)): Ensures the concrete collection type for key, and adds the given value(s) to it.

Smart internationalization for .NET web apps;
    Globally recognized interface; localize like the big kids;
    Localizes everything; controller calls, views, validation attributes, and routes.
